import React, { useState } from "react";
import "./App.css";

interface Person {
  name: string;
  url: string;
  age: number;
  note?: string;
}

function App() {
  const [people, setPeople] = useState<Person[]>([]);

  return (
    <div className="App">
      <h1>People Invited to my Party</h1>
      <ul>
        {people.map((person) => (
          <li>{person.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
